%% Parametric Analysis of Wall Thermal Conductivity on the Performance  %[output:37f58794] %[output:7ad7b1d5] %[output:0702aecb] %[output:04c0264b] %[output:1751dbd4] %[output:63c45994] %[output:82e7666c] %[output:842d4ba1]
%  of Segmented Microchannel Methanol Reformers
% Purpose: This study analyzes CFD simulation data to determine how 
%          wall thermal conductivity affects heat transfer in a microchannel reactor.
%          The script loads numerical results, calculates key performance 
%          metrics, and generates visualizations to identify 
%          the optimal material properties for thermal stability and efficiency.
% Author:  Bello Oluwatobi
% Date:    December 16, 2025
%%
clc; clear; close all;
%%
%[text] 1\. Data Loading
%%
% loading the dataset from the CSV file
data = readtable('./data/combined_nusselt_data.csv');
%%
%[text] 2\. Study Parameters Setup
%%
% extracting the total reactor length from the data
L_reactor = max(data.Distance); 

% setting the Reynolds number for the laminar flow regime
Target_Re_L = 200; 
       
% calculating the scaling factor and converts streamwise distance to Local Reynolds Number
Re_factor = Target_Re_L / L_reactor;
data.Re_x = data.Distance * Re_factor;

% extracting all unique thermal conductivity values in the dataset
k_values = unique(data.Conductivity);

% displaying the calculated study parameters
fprintf('--- STUDY PARAMETERS ---\n'); %[output:85860008]
fprintf('Reactor Length:      %.4f m\n', L_reactor); %[output:6fb76db2]
fprintf('Target Reynolds No:  %.0f (Laminar)\n', Target_Re_L); %[output:9e23f53b]
fprintf('Scaling Factor:      %.0f m^-1\n\n', Re_factor); %[output:83573114]
%%
%[text] 3\. Figure 1: 3D Thermal Response Surface Plot
%%
% initializing the figure window
figure('Color', 'w', 'Position', [50, 50, 1000, 700]); %[output:3662c6f1]

% creating a grid for the 3D surface interpolation
re_vec = linspace(min(data.Re_x), max(data.Re_x), 150);
k_vec = linspace(min(k_values), max(k_values), 150);
[RE, K] = meshgrid(re_vec, k_vec);

% interpolating the Nusselt number data onto the grid
NU = griddata(data.Re_x, data.Conductivity, data.Nusselt, RE, K, 'natural');

% plotting the 3D surface plot
surf(RE, K, NU, 'EdgeColor', 'none', 'FaceAlpha', 0.95); %[output:3662c6f1]
colormap(jet); cb = colorbar; %[output:3662c6f1]
ylabel(cb, 'Nusselt Number (Nu)', 'FontSize', 11, 'FontWeight', 'bold'); %[output:3662c6f1]

% setting the axis labels and title and graph lighting
xlabel('Local Reynolds Number (Re_x)', 'FontSize', 12, 'FontWeight', 'bold'); %[output:3662c6f1]
ylabel('Wall Conductivity (k_w)', 'FontSize', 12, 'FontWeight', 'bold'); %[output:3662c6f1]
zlabel('Nu', 'FontSize', 12, 'FontWeight', 'bold'); %[output:3662c6f1]
title({'Thermal Response Surface Plot - Transition from Insulating to Isothermal Regimes'}, 'FontSize', 14); %[output:3662c6f1]
view(-35, 35); camlight; lighting gouraud; grid on; %[output:3662c6f1]

% saving the figure
saveas(gcf, fullfile('results', '3D_Surface_Plot.png')); %[output:3662c6f1]
%%
%[text] 4\. Figure 2: Streamwise Nusselt Number Profiles
%%
% initializing the figure window
figure('Color','w', 'Position', [100, 100, 900, 600]); %[output:13a6b2e9]
hold on; %[output:13a6b2e9]

% identifying the unique conductivity values
unique_ks = unique(data.Conductivity);

% defining colors for the graphs 
custom_colors = [
    0 0 0;             % k=0.2 
    0 0.447 0.741;     % k=0.6 
    0.466 0.674 0.188; % k=2.0
    0.929 0.694 0.125; % k=6.0 
    0.494 0.184 0.556; % k=20.0 
    0.635 0.078 0.184; % k=60.0
];

% looping through each conductivity value to plot its profile
for i = 1:length(unique_ks)
    k = unique_ks(i);
    
    % filtering the data for the current conductivity value
    sub = data(data.Conductivity == k, :);
    [~, idx] = sort(sub.Distance);
    
    % creating the legend label
    label_str = sprintf('k = %.1f W/m-K', k);
    
    % selecting the color and plotting the line
    color_idx = mod(i-1, size(custom_colors, 1)) + 1;
    plot(sub.Distance(idx)*1000, sub.Nusselt(idx), ... %[output:13a6b2e9]
        'LineWidth', 2.0, ...  %[output:13a6b2e9]
        'Color', custom_colors(color_idx, :), ... %[output:13a6b2e9]
        'DisplayName', label_str); %[output:13a6b2e9]
end

% adding vertical lines to represent the 1mm segmentation grid
limit_x = 0.03; % setting the domain limit
for x = 1:2:(limit_x*1000)
    xline(x, '--k', 'Alpha', 0.2, 'HandleVisibility','off'); %[output:13a6b2e9]
end

% setting the axis labels, title, and legend
xlabel('Channel Distance (mm)', 'FontSize', 12, 'FontWeight','bold'); %[output:13a6b2e9]
ylabel('Local Nusselt Number (Nu)', 'FontSize', 12, 'FontWeight','bold'); %[output:13a6b2e9]
title('Streamwise Nusselt Number Profiles (All k values)', 'FontSize', 14); %[output:13a6b2e9]
legend('Location', 'bestoutside');  %[output:13a6b2e9]
grid on; box on; %[output:13a6b2e9]

% saving the figure
saveas(gcf, fullfile('results', 'Regime_Profiles_All.png')); %[output:13a6b2e9]
%%
%[text] 5\. Figure 3 : Thermal Performance Trade-off Curve
%%
% calculating the mean Nusselt number for each conductivity value
avg_nu = zeros(length(k_values), 1);
for i = 1:length(k_values)
    avg_nu(i) = mean(data.Nusselt(data.Conductivity == k_values(i)));
end

% initializing the figure and plotting the trade-off curve
figure('Color','w', 'Position', [150, 150, 800, 500]); %[output:4e028b24]
plot(k_values, avg_nu, '-s', 'LineWidth', 2, 'MarkerFaceColor', 'b', 'Color', 'k'); %[output:4e028b24]

% setting the axis labels and title
xlabel('Wall Conductivity (W/m-K)', 'FontSize', 12, 'FontWeight','bold'); %[output:4e028b24]
ylabel('Time-Averaged Nusselt Number', 'FontSize', 12, 'FontWeight','bold'); %[output:4e028b24]
title('Thermal Performance Trade-off Curve', 'FontSize', 14); %[output:4e028b24]
grid on; %[output:4e028b24]

% saving the figure
saveas(gcf, fullfile('results', 'Thermal_Performance_Curve.png')); %[output:4e028b24]
%%
%[text] 6\. Figure 4: Heat Transfer Improvement Ratio
% initializing the figure window
figure('Color','w', 'Position', [200, 200, 900, 600]); %[output:1daf8346]
hold on; %[output:1daf8346]

% creating a common x-axis vector for interpolation
common_x = linspace(0, L_reactor, 200);

% interpolating data for the insulating regime (k=0.2)
base = data(data.Conductivity == 0.2, :);
nu_base = interp1(base.Distance, base.Nusselt, common_x, 'linear', 'extrap');

% interpolating data for the transition regime (k=6.0)
peak = data(data.Conductivity == 6.0, :);
nu_peak = interp1(peak.Distance, peak.Nusselt, common_x, 'linear', 'extrap');

% calculating the enhancement ratio
enhancement = nu_peak ./ nu_base;

% plotting the enhancement area and the insulating regime line
area(common_x*1000, enhancement, 'FaceColor', [0.3 0.7 0.3], 'FaceAlpha', 0.5); %[output:1daf8346]
yline(1.0, '--k', 'Insulating Regime'); %[output:1daf8346]

% setting the axis labels and title
xlabel('Channel Distance (mm)', 'FontSize', 12, 'FontWeight','bold'); %[output:1daf8346]
ylabel('Heat Transfer Improvement Ratio (Nu_{k=6} / Nu_{k=0.2})', 'FontSize', 12, 'FontWeight','bold'); %[output:1daf8346]
title({'Heat Transfer Improvement Ratio - Transition (k=6) vs Insulating Regime (k=0.2)'}, 'FontSize', 14); %[output:1daf8346]
grid on; %[output:1daf8346]

% saving the figure
saveas(gcf, fullfile('results', 'Heat_Transfer_Improvement_Ratio.png')); %[output:1daf8346]

